import React from "react";

import { frame } from "../../utils/Constant";

const Frame = () => {

  return (
    <div className="Frame w-full h-auto">
      <div className=" ">
        <div className="ring-1 grid gap-8 grid-cols-4 grid-rows-2 ">
          {frame.map((k, i) => {
            return <span key={i}>{k.title}</span>;
          })}
        </div>

      </div>
    </div>
  );
};

export default Frame;
